def readCSV2List(filePath):
 try:
  file=open(filePath,'r',encoding="gbk")# 读取以utf-8
  context = file.read() # 读取成str
  list_result=context.split("\n")# 以回车符\n分割成单独的行
  #每一行的各个元素是以【,】分割的，因此可以
  length=len(list_result)
  for i in range(length):
   list_result[i]=list_result[i].split(",")
  return list_result
 except Exception :
  print("文件读取转换失败，请检查文件路径及文件编码是否正确")
 finally:
  file.close();# 操作完成一定要关闭
def read_out_file(path):
    try:
        f = open(path, 'r', encoding='utf-8')
        data = f.readlines()
        f.close()
        print("文件读取成功！")
        return data
    except IOError:
        print('文件读取失败！')
def acc(y_test,test_predict):

    score = accuracy_score(y_test, test_predict)
    print('Accuracy：%.2f%%' % (score * 100))

    # 精准率
    precision = precision_score(y_test, test_predict)
    print('Precision：%.2f%%' % (precision * 100))

    # 召回率
    recall = recall_score(y_test, test_predict)
    print('Recall：%.2f%%' % (recall * 100))

    # F1值
    f1 = f1_score(y_test, test_predict)
    print('F1：%.2f%%' % (f1 * 100))

    # auc曲线下面积
    auc = roc_auc_score(y_test, test_predict)
    print('AUC：%.2f%%' % (auc * 100))

    # ks值
    fpr, tpr, thresholds = roc_curve(y_test, test_predict)
    ks = max(abs(fpr - tpr))
    print('KS：%.2f%%' % (ks * 100))

